int main() {

  int i;
  int j;
  int x;
  int y;

  (i = x);
  (j = y);

  /*@
loop invariant i1: i == x + i_initial;
loop invariant i2: j == y + j_initial;
loop invariant i3: i_initial == j_initial;
loop invariant i4: x >= 0;
loop invariant i5: y >= 0;
loop invariant i6: i - x == j - y;
loop invariant i7: i == x + j;
loop invariant i8: y == j - x;
loop invariant i9: i - j == x - y;
loop invariant i10: i == x + j - y;
loop invariant i11: j == y + (i - x);
loop invariant i12: i_initial - j_initial == x - y;
loop invariant i13: y == j - (i - x);
loop invariant i14: y == j;
*/
while ((x != 0)) {
    {
    (x  = (x - 1));
    (y  = (y - 1));
    }

  }

if ( (y != 0) )
{;
//@ assert( (i != j) );
}

}

